import { Button } from "@mui/material";
import { Route, Routes } from "react-router-dom";
import Login from "./page/login";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/" element={<Login />} />
        </Routes>
      </header>
    </div>
  );
}

export default App;
